import { doc, getDoc } from "firebase/firestore";
import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { db } from "../firebase";
import NavBar from "../NavBar/NavBar";
import "./ProductDetail.css";

const ProductDetails = () => {
  const { productId } = useParams();
  const [product, setProduct] = useState(null);
  const [loading, setLoading] = useState(true);

  console.log("1. Composant rendu avec productId:", productId); // Log initial

  useEffect(() => {
    console.log("2. useEffect déclenché avec productId:", productId);

    const fetchProduct = async () => {
      console.log("3. Début de fetchProduct");
      try {
        console.log("4. Création de la référence avec productId:", productId);
        const productRef = doc(db, "products", productId);

        console.log("5. Tentative de récupération du document");
        const productSnap = await getDoc(productRef);

        console.log("6. Document existe?", productSnap.exists());
        console.log("7. Données brutes:", productSnap.data());

        if (productSnap.exists()) {
          const productData = {
            id: productSnap.id,
            ...productSnap.data(),
          };
          console.log("8. Données formatées:", productData);
          setProduct(productData);
        } else {
          console.log("9. Document non trouvé!");
        }
      } catch (error) {
        console.error("10. ERREUR lors de la récupération:", error);
      } finally {
        console.log("11. Fin du chargement");
        setLoading(false);
      }
    };

    if (productId) {
      console.log("12. Appel de fetchProduct car productId existe");
      fetchProduct();
    } else {
      console.log("13. productId manquant!");
      setLoading(false);
    }
  }, [productId]);

  console.log("14. État actuel:", { loading, product, productId });

  if (loading) {
    console.log("15. Affichage du chargement");
    return (
      <div>
        <NavBar />
        <div className="loading">Chargement...</div>
      </div>
    );
  }

  if (!product) {
    console.log("16. Produit non trouvé");
    return (
      <div>
        <NavBar />
        <div className="error">Produit non trouvé</div>
      </div>
    );
  }

  console.log("17. Rendu du produit:", product);
  return (
    <div>
      <NavBar />
      <div className="product-detail-container">
        <div className="product-detail">
          <div className="product-image">
            <img src={product.imageUrl} alt={product.name} />
          </div>
          <div className="product-info">
            <h1>{product.name}</h1>
            <p className="price">${product.price}</p>
            <p className="description">{product.description}</p>
            {product.server && (
              <p className="server">Serveur: {product.server}</p>
            )}
            {product.subProduct && product.subProduct.length > 0 && (
              <div className="versions">
                <h3>Versions disponibles:</h3>
                <ul>
                  {product.subProduct.map((sub, index) => (
                    <li key={index}>
                      <span className="version-name">{sub.dlc}</span>
                      <span className="version-price">${sub.price}</span>
                    </li>
                  ))}
                </ul>
              </div>
            )}
            <div className="category">
              <span>Catégorie: {product.categorie}</span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ProductDetails;
